import React from "react";
import { Col, Row } from "react-bootstrap";

function AboutUs() {
  return (
    <>
      <Row>
        <Col className="text-center my-5">
          <h2>About Us</h2>
          <p style={{ color: "#e39210", fontStyle: "italic" }}>
            Find the products that you like here at an affordable price.
          </p>
        </Col>
      </Row>
      <Row>
        <Col md={4}>
          <div style={{ position: "relative", top: 0, left: 0 }}>
            <img
              src={require("../assets/pic03.jpg")}
              style={{
                borderRadius: "20px",
                filter: "blur(1px)",
                maxWidth: "80%",

                position: "relative",
                top: 0,
                left: 0,
                marginLeft: "-5%",
              }}
              alt="about us"
            />
            <img
              src={require("../assets/pic01.jpg")}
              style={{
                borderRadius: "20px",

                position: "absolute",
                top: "5%",
                left: "30%",
                maxHeight: "90%",
                maxWidth: "80%",
                boxShadow: "5px 10px 18px #888888",
              }}
              alt="about us"
            />
          </div>
        </Col>
        <Col md={8}>
          <h1
            style={{
              fontWeight: "700",
              fontStyle: "italic",
              fontSize: "300%",
            }}
          >
            wins.
          </h1>
        </Col>
      </Row>
    </>
  );
}

export default AboutUs;
